var ComponentsIonSliders = function () {
	var s = function () {
			$("#range_1").ionRangeSlider(), $("#range_2").ionRangeSlider({
				min: 0,
				max: 1e3,
				from: 550
			}), $("#range_3").ionRangeSlider({
				type: "double",
				grid: !0,
				min: 0,
				max: 1e3,
				from: 200,
				to: 800,
				//prefix: "$"
			})
		};
	return {
		init: function () {
			s()
		}
	}
}();
jQuery(document).ready(function () {
	ComponentsIonSliders.init()
});
